                           </div>
                           <div class="copy-h3-alt">
                              <div class="md:w-96 lg:mr-9 2xl:w-126">Money is complicated enough, so we work hard to make everything about our Cash Account easier to understand. Here are some answers to frequently asked questions:</div>
                           </div>
                        </div>
                        <div class="faq_module_layout__1TEm7 py-8 lg:gap-x-16 xl:gap-x-24">
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">Will the interest rate lock in, or does it change?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">
                                       <div class="space-y-4">
                                          <p>Short answer: it changes based on a number of factors — the most important factor being the Federal Funds Rate.</p>
                                          <p>Long answer: it’s in our best interest to offer our clients a competitive rate, so we’re always looking for opportunities to do just that. When our partner banks pay us more for our deposits, we pay it forward to you with a better APY. We’ll always notify you when the rates change.</p>
                                       </div>
                                    </div>
                                 </div>
                              </div>
                           </div>
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">How hard is it to transfer from savings to investing?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">So not hard at all! When the market is open, money can usually be transferred to your taxable Investment Account or IRA in minutes.<a aria-label="Learn more about moving money between Wealthfront accounts" class="z-10 relative font-medium underline text-eggplant" href="https://support.wealthfront.com/hc/en-us/articles/360054546671" rel="noopener noreferrer" target="_blank">Learn more</a></div>
                                 </div>
                              </div>
                           </div>
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">But what if I want to withdraw my money?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">
                                       <div class="space-y-4">
                                          <p>
                                             It’s your money, so you can withdraw it whenever you want. If your external account is in the<!-- --> <a class="z-10 relative font-medium underline text-eggplant" href="https://www.theclearinghouse.org/payment-systems/rtp/rtp-participating-financial-institutions" rel="noopener noreferrer" target="_blank">RTP® Network</a>, it’s eligible for free same-day transfers when you request as late as 6pm PT / 9pm ET every day, even on weekends &amp; holidays!. For other accounts, withdrawals usually take only one business day to arrive, though if it’s from a recent deposit, it may take a few extra days to process.
                                          </p>
                                       </div>
                                    </div>
                                 </div>
                              </div>
                           </div>
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">How many fees are there?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">None! Zilch! Nada! We’ve never charged any account fees for the Cash Account, and we never will.</div>
                                 </div>
                              </div>
                           </div>
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">Unfortunately, I have these things called bills. Can you make them go away?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">We can’t make them go all the way away, but it’s very easy to set up bill pay with the Cash Account. Paying bills is kind of like making them go away, right?</div>
                                 </div>
                              </div>
                           </div>
                           <div class="mt-8 flex flex-col space-y-4 first:mt-0" style="break-inside:avoid-column" data-testid="faq-item">
                              <h3 class="copy-h3-alt">What if I want actual dollar bills in my actual hands?</h3>
                              <div class="copy-body">
                                 <div class="space-y-4">
                                    <div class="flex flex-col items-start">If you’re good with twenties, we’ve got free ATMs IRL. Just use our Debit Card to withdraw from more than 19,000 free ATMs at places like CVS, Target, Walgreens, and many, many more.</div>
                                 </div>
                              </div>
                           </div>
